description:
Verenigde Staten
Actie / Fantasy
88 minuten

goed

met Kate Beckinsale, Charles Dance en India Eisley

Selene (Beckinsale), de vampierenstrijdster, is net uit een twaalfjarige cryogene slaap ontwaakt. De wereld is in die periode 
drastisch veranderd: de mens heeft het bestaan van vampieren en weerwolven ontdekt, en voert een meedogenloze oorlog om beide 
onsterfelijke soorten uit te roeien.
